import "./TodoItem.css";

const deleteIcon = require('../../assets/icons/ic_baseline-delete.png');

function TodoItem(props: any) {
  return (
    <div className="TodoItem">
      <div>
        <input
          type="checkbox"
          checked={props.isDone}
          onChange={() =>
            props.dispatch({ task:props.task, type: "CHANGE_STATUS" })
          }
        ></input>
        <label>{props.task}</label>
      </div>

      <div className="icons">
        <img
          src={deleteIcon}
          onClick={() => props.dispatch({ type: "DELETE_TASK", task:props.task})}
        />

        <img/>
      </div>
    </div>
  );
}

export default TodoItem;
